import React from "react";
import "react-native-gesture-handler";
import RouteManager from "navigation/RouteManager";

const App = () => {
  // At the top of your entry file (e.g., App.js)

  const originalConsoleWarn = console.warn.bind(console);

  console.warn = (message, ...args) => {
    const suppressedWarnings = [
      "BackHandler is not supported on web and should not be used.",
      "selectable prop is deprecated. Use styles.userSelect.",
    ];

    if (!suppressedWarnings.some((entry) => message.includes(entry))) {
      originalConsoleWarn(message, ...args);
    }
  };

  return <RouteManager />;
};

export default App;
